import React from "react";
import "./Home.css";

export const Home = () => (
  <div className="homepage">
    <div className="jumbotron jumbotron-home"></div>
    <div className="container">
      <h1>Westwood Electricity</h1>
      <h3>We get to work and get it done!</h3>
    </div>
  </div>
);
